import Input from '@material-ui/core/TextField';

const styleInput = {
    height: '100px',
    width: '25ch',
    left: "50%",
    top: "50%",
};
const styleBack = {
    margin: '10px',
    background: '#ccc',
    height: '300px',
    width: '30ch',
    left: "50%",
    top: "50%",
    borderRadius: "16px"
}

const Login = () =>{
    return(
        <div style = {styleBack}>
            <form style={styleInput}>
                <Input placeholder="YourEmail@mail.com" 
                inputProps={{ 'aria-label': 'description' }} />
            </form>
        </div>
    )
}

export default Login;
